- VSCode Version: 1.17.0-insider (6039e061a8b8f82114500c34c679f991f9607e71)
- OS Version: Ubuntu 16.04.3

Steps to Reproduce:

1. Register a onDidChangeWorkspaceFolders handler like the following in a VS Code extension:
```
vscode.workspace.onDidChangeWorkspaceFolders(e => {
  for (const added of e.added) {
    const config = vscode.workspace.getConfiguration('tasks', e.added);
    console.log(config);
  }
});
```

2. Add a `.vscode/tasks.json` file to a project folder. For example:
```
{
	"version": "2.0.0",
	"tasks": [
		{
			"type": "shell",
			"command": "virtualenv -p python ./env",
			"taskName": "Install virtualenv"
		}
	]
}
```

3. Add the project as a workspace folder to VS Code (assuming it is running the extension from step 1).
4. Expected: The task configuration for the just-added workspace folder is printed to the dev console. Actual: An empty object is printed.

It appears that at the time `onDidChangeWorkspaceFolders` is fired, the configuration for the corresponding workspace folder has not yet been loaded. The example given above refers specifically to the tasks configuration, but in general, this applies to any workspace-folder-level configuration. A workaround that seems to work is to use `setTimeout(() => { ... }, 0)` inside the handler. Empirically, the configuration for the newly added workspace folder(s) has been added by the time the inner function runs. It would be useful to run commands that depend on the workspace folder configuration in response to workspace folder addition / removal (e.g., automatically build a newly added workspace folder).

Proposal: make the `onDidChangeWorkspaceFolders` fire after the configuration for newly added workspaces has already been loaded. Or alternatively, add a new event that fires at this time.
